import React from 'react';
import MarketPrices from '../components/MarketPrices';

const LivePricesPage = () => {
  return (
    <div>
      <h1>Live Cryptocurrency Prices</h1>
      <MarketPrices />
    </div>
  );
};

export default LivePricesPage;
